Here's the thing. I quit smoking. Then I started smoking again. I encountered a large amount of stress. I have a bad relationship with food again. I stopped taking care of myself and started feeling sorry for myself. The past year has not been what I wanted for myself physically. 

Personally, I've been working to be happy, and I've been mostly successful. While some things in my professional life haven't gone the way I hoped or even expected them to, I've developed more as an adult, a mother, a wife, a sister, and a person than I ever expected to.

I've learned how to be less co-dependent. I've spent more time with my kids and started picking up some of the slack around the house. I've been more supportive of my husband. I started reading again. I'm enrolled in an online marketing program for my associates, and I'm very excited to start planning and developing my business over the next couple of years.

Now I need to tackle my physical goals. My body hurts. My heart and head hurt. I feel exhausted and groggy. I feel like a shell of myself, physically, and haven't been able to do things I was previously able to do. I hate what I see in the mirror. And while I'd love to embrace the body positivity movement that has been taking place, I have some work to put in before I can really appreciate what my body can do and has done. 

I was reluctant to post these, because people I know in real life follow me on this account. I hide what I look like under hoodies and baggy clothing, unless it's a particularly sunny day and I have to break out the athletic shorts, or I'm in my tummy hiding leggings. I know I'm not entirely fooling people, and it's time to stop worrying about what other people think and start being more concerned about my relationship with myself. 

So here we are. At the beginning. 

